import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { FaSun, FaMoon } from 'react-icons/fa';
import TodoList from './components/TodoList';
import TodoForm from './components/TodoForm';

function App() {
  const [todos, setTodos] = useState([]);
  const [darkMode, setDarkMode] = useState(false);

  // Fetch todos from backend
  useEffect(() => {
    const fetchTodos = async () => {
      try {
        const response = await axios.get('http://localhost:5000/api/todos');
        setTodos(response.data);
      } catch (error) {
        console.error('Error fetching todos:', error);
      }
    };

    fetchTodos();
  }, []);

  // Add new todo
  const addTodo = async (todoData) => {
    try {
      const response = await axios.post('http://localhost:5000/api/todos', todoData);
      setTodos([response.data, ...todos]);
    } catch (error) {
      console.error('Error adding todo:', error);
    }
  };

  // Delete todo
  const deleteTodo = async (id) => {
    try {
      await axios.delete(`http://localhost:5000/api/todos/${id}`);
      setTodos(todos.filter(todo => todo._id !== id));
    } catch (error) {
      console.error('Error deleting todo:', error);
    }
  };

  // Toggle todo completion
  const toggleComplete = async (id) => {
    try {
      const todoToUpdate = todos.find(todo => todo._id === id);
      const response = await axios.put(`http://localhost:5000/api/todos/${id}`, {
        completed: !todoToUpdate.completed
      });
      setTodos(todos.map(todo => 
        todo._id === id ? response.data : todo
      ));
    } catch (error) {
      console.error('Error updating todo:', error);
    }
  };

  // Edit todo
  const editTodo = async (id, updates) => {
    try {
      const response = await axios.put(`http://localhost:5000/api/todos/${id}`, updates);
      setTodos(todos.map(todo => 
        todo._id === id ? response.data : todo
      ));
    } catch (error) {
      console.error('Error editing todo:', error);
    }
  };

  // Clear completed todos
  const clearCompleted = async () => {
    try {
      const completedIds = todos
        .filter(todo => todo.completed)
        .map(todo => todo._id);

      await Promise.all(completedIds.map(id => 
        axios.delete(`http://localhost:5000/api/todos/${id}`)
      ));

      setTodos(todos.filter(todo => !todo.completed));
    } catch (error) {
      console.error('Error clearing completed todos:', error);
    }
  };

  return (
    <div className={`
      min-h-screen 
      ${darkMode ? 'bg-gray-900 text-white' : 'bg-gray-100'} 
      py-6 flex flex-col justify-center sm:py-12
    `}>
      <div className="absolute top-4 right-4">
        <button 
          onClick={() => setDarkMode(!darkMode)}
          className={`
            p-3 rounded-full transition-colors
            ${darkMode 
              ? 'bg-yellow-500 text-gray-900 hover:bg-yellow-400' 
              : 'bg-gray-200 text-gray-700 hover:bg-gray-300'
            }
          `}
        >
          {darkMode ? <FaSun /> : <FaMoon />}
        </button>
      </div>

      <div className="relative py-3 sm:max-w-xl sm:mx-auto">
        <div className={`
          absolute inset-0 
          ${darkMode 
            ? 'bg-gradient-to-r from-purple-800 to-indigo-900' 
            : 'bg-gradient-to-r from-cyan-400 to-light-blue-500'
          } 
          shadow-lg transform -skew-y-6 sm:skew-y-0 sm:-rotate-6 sm:rounded-3xl
        `}></div>
        <div className={`
          relative px-4 py-10 shadow-lg sm:rounded-3xl sm:p-20
          ${darkMode ? 'bg-gray-800 text-gray-100' : 'bg-white text-gray-900'}
        `}>
          <div className="max-w-md mx-auto">
            <div className="divide-y divide-gray-200">
              <div className="py-8 text-base leading-6 space-y-4 sm:text-lg sm:leading-7">
                <h1 className={`
                  text-3xl font-extrabold text-center 
                  ${darkMode ? 'text-white' : 'text-gray-900'}
                `}>Todo List</h1>
                <TodoForm onAdd={addTodo} />
                <TodoList 
                  todos={todos} 
                  onDelete={deleteTodo} 
                  onToggleComplete={toggleComplete} 
                  onEdit={editTodo}
                  darkMode={darkMode}
                />
                {todos.some(todo => todo.completed) && (
                  <div className="text-center mt-4">
                    <button 
                      onClick={clearCompleted}
                      className={`
                        px-4 py-2 rounded-lg transition-colors
                        ${darkMode 
                          ? 'bg-red-700 text-white hover:bg-red-600' 
                          : 'bg-red-500 text-white hover:bg-red-600'
                        }
                      `}
                    >
                      Clear Completed
                    </button>
                  </div>
                )}
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
